// Solution 1: Using two pointers, a front one and a rear one, moving torwards each other.
int strStr(char* haystack, char* needle) {

  if (*needle == '\0')
    return 0;
  if (*haystack == '\0')
    return -1;

  int index = 0;
  int ln = strlen(needle);
  int lh = strlen(haystack);
  char * pn0 = needle;
  char * pn1 = needle + ln -1;
  char * ph0 = haystack;
  char * ph1 = haystack + ln -1;

  while (haystack[index]) {
    if (haystack[index] != *needle)
      ++ index;
    else {
      pn0 = needle;
      pn1 = needle + ln -1;
      ph0 = haystack + index;
      ph1 = haystack + index + ln -1;
      if (ph1 > haystack + lh -1)
        return -1;
      while (pn0 <= pn1)
        if (*pn0!=*ph0 || *pn1!=*ph1)
          break;
        else {
          ++ pn0;
          ++ ph0;
          -- pn1;
          -- ph1;
        }
      if (pn0==pn1+1 || pn0==pn1+2)
        return index;

      ++ index;
    }
  }

  return -1;
}


